import React from 'react'
import ArtData from '../assets/_legacy-art.json'
import FeatureCard from '../components/FeatureCard'
import { useState, useEffect } from 'react'
import axios from "axios";

function SearchGrid() {

    const [artData, setartData] = useState({})
    const [obj, setObj] = useState({})

    useEffect(() => {
      // Update the document title using the browser API
      async function getData(){
        await axios.get('http://localhost:3001/v1/heartofvalley/features').then((res) => {
          setartData(res.data)
          console.log(artData);
        });
      }

      getData()
    },[obj]);
    setObj(artData)
  return (
    <div className="container mt-5 d-flex justify-content-around flex-wrap ">

        {artData.map((data, key) => {
                return <FeatureCard imgAddr={data.imagePath}  title={data.title} />;
            })} 
    </div>
  )
}

export default SearchGrid
